import { VerticalTimeline, VerticalTimelineElement } from "react-vertical-timeline-component";
import 'react-vertical-timeline-component/style.min.css';

function Itinerary(props) {

    return (
        <div style={{backgroundColor: 'rgb(170, 170, 170)'}}>
        <VerticalTimeline>
            <VerticalTimelineElement
                className="vertical-timeline-element--work"
                contentStyle={{ background: 'rgb(170, 170, 170)', color: '#000' }}
                contentArrowStyle={{ borderRight: '7px solid  rgb(170, 170, 170)' }}
                date="11:00am"
                iconStyle={{ background: 'rgb(150, 150, 150)', color: '#fff' }}
            >
                <h3 className="vertical-timeline-element-title">Restaurant</h3>
                <p>This is really good</p>
            </VerticalTimelineElement>
            <VerticalTimelineElement
                date = "1:45pm"
            >
                <h3 className="vertical-timeline-element-title">Restaurant</h3>
                <p>This is really good</p>
            </VerticalTimelineElement>
        </VerticalTimeline>
        </div>
    );
}

export default Itinerary;
